import * as React from 'react';
import { StyleSheet, Text, View } from 'react-native';

const styles=StyleSheet.create({
    card:{
        flex:1,
        alignContent:"center",
        height: "100%",
        width: "100%",
        backgroundColor:'#fafafa',
        borderWidth:3,
        borderColor:"black",
        borderRadius:25,
        position:'absolute'
    },
    imgBar:{
        height:"5%"
    },
    img:{
        height:"80%",
        backgroundColor:"black"
    },
    cardTitleView:{
        flexDirection:"row",
        height:"18%",
        borderWidth:3,
        borderColor:"black",
        borderRadius:25,
        width: "104%",
        position: "absolute",
        bottom:0,
        left:"-2%",
        backgroundColor:"#ffffff",
        paddingTop:"5%",
        paddingLeft:"3%",
        paddingRight:"3%"
    },
    userCircleContainer:{
        height:"80%",
        justifyContent:"center",
        alignContent: "center",
        flexDirection: "column",
        flex:2,
    },
    userCircle:{
        width:50,
        height:50,
        borderRadius:25,
        borderWidth:2,
        backgroundColor:"#d6d4d4",
    },
    cardTitleContainer:{
        flex:7,
        paddingLeft: "3%",
        height:"80%",
        justifyContent:"center",
        flexDirection: "column"
    },
    cardTitle:{
        fontSize:20,
        fontWeight:"bold",
    },
    productValueContainer:{
        height:"80%",
        flex:2,
        justifyContent:"center",
        flexDirection: "column"
    },
    productValue:{
        fontSize:15,
    }
})

export default class MatchesTab extends React.Component {
    render() {
        return (
            <View style={styles.viewContainer}>
                <Text style={styles.topText}>Profilo</Text>
                <View style={{ height:"10%" }}>{/* Filter bar */}</View>
                <View style={styles.cardContainer}>
                </View>
            </View>
        );
    }
}
